function App() {
    return (
      <Router>
        <Topbar />
        <div className="container">
          <Sidebar />
          <Route>
            <Route exact path="/">
              <Home />
            </Route>
            <Route path="/users">
              <User />
            </Route>
          </Route>
        </div>
      </Router>
    );
  }

export default App;
